import { FETCH_COURSES_CATALOG } from "../Action/type";
const initialState = []


const CourseCatalog = (state = initialState, { type, payload }) => {
    switch (type) {

        case FETCH_COURSES_CATALOG:
            return state = payload

        default:
            return state
    }
}

export default CourseCatalog
